        $(".egyptbox").addClass("animated");
        $(".egyptbox").removeClass("fadeOutDownBig");
        $(".shield").fadeIn();
      });
      $(".egyptbox").click(function() {

      });
      $(".africa").click(function() {
        $("path:not(.africa)").fadeOut();
      });
